// src/components/PersonalCard.jsx
import React from "react";

function PersonalCard() {
  return (
    <div className="relative bg-white shadow-md rounded-2xl p-6 border border-gray-200">
      {/* Circle label */}
      <div className="absolute -top-5 left-6">
        <div className="w-20 h-20 rounded-full bg-black text-white flex items-center justify-center text-sm tracking-wider font-semibold shadow-md">
          PERSONAL
        </div>
      </div>

      {/* Card Content */}
      <div className="mt-16 space-y-4">
        <h3 className="text-lg font-semibold tracking-wide">To-Do List</h3>
        <h3 className="text-lg font-semibold tracking-wide">Journal</h3>
        <h3 className="text-lg font-semibold tracking-wide">Goals</h3>
        <h3 className="text-lg font-semibold tracking-wide">Habits</h3>
      </div>
    </div>
  );
}

export default PersonalCard;
